import React from 'react'

function Orb() {


    const orbStyle = styled.div`
        width: 70vh;
        height: 70vh;
        position: absolute;
        border-radius: 50%;
        margin-left: -37vh;
        margin-top: -37vh;
        background-color: liner-gradient(180deg, #f56692 0%, #f2994a 100%);
        filter: blur(400px);
        `;
    return (
        <orbStyle>Orb</orbStyle>
    )
}
